 ('3', '4', 'en_us', 'the school of artist', NULL, NULL, '<p>\r\n	        This is the song description.\r\n</p>', '[{\"col1\":\"\"}]', '0000-00-00 00:00:00', '', '', 'audio', '1999', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-06-13 20:42:35', '2013-08-01 01:32:24', '7e559572-c549-472f-8bc1-8cfed1cc048c'),
