 ('219', '220', 'en_us', 'The Four Immeasurable', NULL, NULL, '<p>\r\n	Wish everything has happiness and the cause of happiness.\r\n</p>\r\n<p>\r\n	Wish everything has no bitterness and away from the cause of bitterness.\r\n</p>\r\n<p>\r\n	Wish everything has luck and the cause of luck.\r\n</p>\r\n<p>\r\n	Wish everything has no hatry, desire, lust and anger.\r\n</p>', '[{\"col1\":\"soprano\"},{\"col1\":\"alto\"},{\"col1\":\"tenor\"},{\"col1\":\"bass\"},{\"col1\":\"mixed choir\"},{\"col1\":\"orchestra\"}]', '8:28', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jun-Chiang Chiu\"},{\"col1\":\"orchestra\",\"col2\":\"Taipei Philharmonics\"}]', '', 'audio', '2007', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:21:31', '2013-08-27 14:21:31', '50659dae-c46f-4882-acc2-6c6c7c4a9389'),
