 ('261', '262', 'en_us', 'Lost Time', NULL, NULL, '<p>\r\n	Every moment is a frozen shoot, by repeating and deleting, finally realize what happens at the very first second.\r\n</p>', '[{\"col1\":\"flute\"},{\"col1\":\"clarinet\"},{\"col1\":\"bassoon\"},{\"col1\":\"horn\"},{\"col1\":\"trombone\"},{\"col1\":\"2 percussions\"},{\"col1\":\"2 violins\"},{\"col1\":\"violoncello\"},{\"col1\":\"contrabass\"}]', '4:52', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Yu-Chung Johnny Ku\"},{\"col1\":\"flute\",\"col2\":\"Chia-Jui He\"},{\"col1\":\"clarinet\",\"col2\":\"Merlin Von Frankenberg\"},{\"col1\":\"bassoon\",\"col2\":\"Yi-chen Chiu\"},{\"col1\":\"horn\",\"col2\":\"Blake Yarbrough\"},{\"col1\":\"trumpet\",\"col2\":\"Shao-Chun Tsai\"},{\"col1\":\"trombone\",\"col2\":\"Kelvin Chan\"},{\"col1\":\"percussion\",\"col2\":\"Wei-Chen Lin and Joseph Van Hassel\"},{\"col1\":\"violin\",\"col2\":\"Yen-Ting Wu and Chi-fan Tsai\"},{\"col1\":\"violoncello\",\"col2\":\"Yi-Ching Lee\"},{\"col1\":\"contrabass\",\"col2\":\"Briana Goldberg\"}]', '', 'audio', '2012', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 15:30:51', '2013-08-27 15:30:51', '9121a265-54fb-4c0f-8497-87580e5ffd9f'),
