 ('269', '270', 'en_us', 'Renascence', NULL, NULL, '<p>\r\n	Art is life in a deferent tempo.\r\n</p>\r\n<p>\r\n	Countless natural disasters happened in recent years. On on hand, thinking about that there are people suffering somewhere out there makes me worried. But on the other hand, knowing that there are people devoting themselves for a better world comforts me.\r\n</p>\r\n<p>\r\n	The piece to that is to marvel human wisdom, and to show respect for the power of nature. I pray for the lives in miseries in the past, the present, and the future.\r\n</p>\r\n<p>\r\n	In the end of the music, I hope the audience can hum with the performers with Mahler\'s Resurrection to find the peace on our heart. Maestro Fusao Kajim once described, \"just like going back to Mother\'s embrace.\"\r\n</p>', '[{\"col1\":\"flute\"},{\"col1\":\"clarinet\"},{\"col1\":\"bassoon\"},{\"col1\":\"trombone\"},{\"col1\":\"percussion\"},{\"col1\":\"piano\"},{\"col1\":\"string quartet\"},{\"col1\":\"contrabass\"},{\"col1\":\"tape\"}]', '10:59', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Fusao Kajim\"},{\"col1\":\"orchestra\",\"col2\":\"National Taiwan Orchestra Symphony\"}]', '', 'audio', '2003', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 15:44:41', '2013-08-27 15:44:41', 'fde043c6-0735-41f6-b43d-f30449d42353'),
