 ('273', '274', 'en_us', 'Fisherman\'s Song', NULL, NULL, '<p>\r\n	Egrets fly in front of West Piedmont,\r\n</p>\r\n<p>\r\n	Peach flowers flow away with water;\r\n</p>\r\n<p>\r\n	Mandarin fish fertilize,\r\n</p>\r\n<p>\r\n	Having green rain cap and coat,\r\n</p>\r\n<p>\r\n	With no worry for the light wind and the drizzling rain.\r\n</p>', '[{\"col1\":\"mixed choir\"}]', '10:47', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Yu-Ching Johnny Ku\"},{\"col1\":\"lyricist\",\"col2\":\"Zhang Zhi He\"},{\"col1\":\"choir\",\"col2\":\"Ming De Choir\"}]', '', 'audio', '2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 15:50:26', '2013-08-27 15:50:26', '3b266838-efea-4481-a208-ded485fa0820'),
