 ('55', '51', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Suite No.2 in B minor\",\"slug\":\"suite-no-2-in-b-minor\",\"postDate\":1375422300,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"y\",\"4\":[\"22\",\"25\"],\"41\":[\"38\"],\"6\":\"Hsin-Lei Chen\",\"3\":\"<p>\\r\\n\\t The four orchestral suites (called ouvertures by their author), BWV 1066\\u20131069 are four suites by Johann Sebastian Bach. The name ouverture refers only in part to the opening movement in the style of the French overture, in which a majestic opening section in relatively slow dotted-note rhythm in duple meter is followed by a fast fugal section in triple meter, then rounded off with a short recapitulation of the opening music. More broadly, the term was used in Baroque Germany for a suite of dance-pieces in French Baroque style preceded by such an ouverture. This genre was extremely popular in Germany during Bach\'s day, and he showed far less interest in it than was usual: Robin Stowell writes that \\\"Telemann\'s 135 surviving examples [represent] only a fraction of those he is known to have written\\\";[1] Christoph Graupner left 85 (listed in his Wikipedia entry); and Johann Friedrich Fasch left almost 100 (listed in his Wikipedia entry). Bach did write several other ouverture (suites) for solo instruments, notably the Cello Suite no. 5, BWV 1011, which also exists in the autograph Lute Suite in G minor, BWV 995, the Keyboard Partita no. 4 in D, BWV 828, and the Overture in the French style, BWV 831 for keyboard. The two keyboard works are among the few Bach published, and he prepared the lute suite for a \\\"Monsieur Schouster,\\\" presumably for a fee, so all three may attest to the form\'s popularity,\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t Scholars believe that Bach did not conceive of the four Orchestral Suites as a set (in the way he conceived of the Brandenburg Concertos), since the sources are various, as detailed below.\\r\\n<\\/p>\",\"8\":\"1000\",\"7\":[{\"col1\":\"Flute\"},{\"col1\":\"Viola\"}],\"11\":\"audio\",\"9\":\"Bach\",\"12\":[\"26\"],\"10\":\"\",\"14\":\"1980\"}}', '2013-08-02 05:45:12', '2013-08-02 05:45:12', '523bb818-7849-463b-884e-75c6fbc35376'),
