 ('113', '116', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Willow Catkins\",\"slug\":\"willow-catkins\",\"postDate\":1377546346,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"114\",\"113\"],\"41\":[\"115\"],\"3\":\"<p>\\r\\n\\tWillow catkins fly in the wind like snow dancing under sunshine. Everything is like a dream. Everything freezes at that moment. Time does not move. Forever, perhaps exists in somewhere we see and do not see.\\r\\n<\\/p>\",\"8\":\"7:17\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"computer music\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Hsiang-chun Chien\"}],\"10\":\"\",\"14\":\"1999\"}}', '2013-08-26 19:45:46', '2013-08-26 19:45:46', 'b0ace534-a8af-4a9b-bbed-c3da570d13f5'),
 ('114', '54', '2', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Solo\",\"slug\":\"solo\",\"postDate\":1377475200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"61\",\"88\",\"89\",\"90\",\"91\",\"92\",\"93\",\"116\"]}}', '2013-08-26 19:45:57', '2013-08-26 19:45:57', '4e876637-d422-4d17-9d20-2d629c3c405e'),
 ('115', '117', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Poemes Fantastiques Mvt.I\",\"slug\":\"poemes-fantastiques-mvt-i\",\"postDate\":1377546532,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"3\":\"<p>\\r\\n\\tMvt. 1\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThirds and minor seconds establish the theme. The composer tries to express tough but still flexible, full of life force. Use pizz. to imitate heartbeats, like pulsation.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tMvt. 2\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe overtone imitates the sound of peaceful whistle. Strength flows out of the inner heart, calmly, and steadily.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tMvt. 3\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tUnder the tense atmosphere, tempt to find a way out. Step by step, become frantic and crazy. At last, escape from the cage, breath in the air from the sky.\\r\\n<\\/p>\",\"8\":\"5:30\",\"7\":[{\"col1\":\"violin solo\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Chia-lun Chang\"}],\"10\":\"\",\"14\":\"2000\"}}', '2013-08-26 19:48:52', '2013-08-26 19:48:52', '1c6858c9-fac3-46f5-beb0-8ee26a12fbf9'),
