 ('165', '184', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"In THE Love\",\"slug\":\"in-the-love\",\"postDate\":1377554575,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"182\",\"181\"],\"41\":[\"183\"],\"3\":\"<p>\\r\\n\\tLove is not to die for, not to possess, but to let it be. No matter in love or losing one, you should set the other free.\\r\\n<\\/p>\",\"8\":\"6:44\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"cello\",\"col2\":\"Song Zhao\"},{\"col1\":\"piano\",\"col2\":\"Jia Lin Zhang\"}],\"10\":\"\",\"14\":\"2011\"}}', '2013-08-26 22:02:55', '2013-08-26 22:02:55', '7985c6c0-69ec-4af0-b1ac-eea9277e14fe'),
