 ('174', '204', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Mvt. II, Recitative\",\"slug\":\"mvt-ii-recitative\",\"postDate\":1377612256,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"201\",\"202\"],\"41\":[\"203\"],\"3\":\"<p>\\r\\n\\tIn the dark and empty theater, after taking off the oil cosmetics and mask for the character in Chinese opera, a person sits there; aspirates; breath and hum.\\r\\n<\\/p>\",\"8\":\"4:52\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"vioin\",\"col2\":\"Pei-yun Hsiao and Kai-si Fan\"},{\"col1\":\"viola\",\"col2\":\"Jun-Yan Lai\"},{\"col1\":\"cello\",\"col2\":\"Peng-yun Hsu\"}],\"10\":\"\",\"14\":\"2006\"}}', '2013-08-27 14:04:17', '2013-08-27 14:04:17', 'ed771ae1-a2ee-4c4a-9a5d-75005601c586'),
