 ('185', '200', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Mvt. I, Mei, Lan-Fang\",\"slug\":\"mvt-i-mei-lan-fang\",\"postDate\":1377612120,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"197\",\"198\"],\"41\":[\"199\"],\"3\":\"<p>\\r\\n\\t The main character of Chinese opera stands on the stage.\\r\\n<\\/p>\",\"8\":\"5:15\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"vioin\",\"col2\":\"Pei-yun Hsiao and Kai-si Fan\"},{\"col1\":\"viola\",\"col2\":\"Jun-Yan Lai\"},{\"col1\":\"cello\",\"col2\":\"Peng-yun Hsu\"}],\"12\":[\"204\"],\"10\":\"\",\"14\":\"2006\"}}', '2013-08-27 14:21:56', '2013-08-27 14:21:56', '1dfbfeb8-b0ac-4361-ae96-e4eb35eb410f'),
 ('186', '204', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Mvt. II, Recitative\",\"slug\":\"mvt-ii-recitative\",\"postDate\":1377612240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"201\",\"202\"],\"41\":[\"203\"],\"3\":\"<p>\\r\\n\\t In the dark and empty theater, after taking off the oil cosmetics and mask for the character in Chinese opera, a person sits there; aspirates; breath and hum.\\r\\n<\\/p>\",\"8\":\"4:52\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"vioin\",\"col2\":\"Pei-yun Hsiao and Kai-si Fan\"},{\"col1\":\"viola\",\"col2\":\"Jun-Yan Lai\"},{\"col1\":\"cello\",\"col2\":\"Peng-yun Hsu\"}],\"12\":[\"200\"],\"10\":\"\",\"14\":\"2006\"}}', '2013-08-27 14:22:06', '2013-08-27 14:22:06', 'caa2ce47-8804-43d5-886d-2c01cd709e1f'),
 ('187', '224', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Long-lived Buddhism Goddess Sutra\",\"slug\":\"long-lived-buddhism-goddess-sutra\",\"postDate\":1377613497,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"222\",\"221\"],\"41\":[\"223\"],\"3\":\"<p>\\r\\n\\tBuddhism Goddess\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tBuddha\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tAffinity with Her\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tKarma with Her\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tDharma and phase as one\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tHappiness with me\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIn the morning read Her name\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIn the twilight think of Her\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThoughts from heart\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThoughts with heart\\r\\n<\\/p>\",\"8\":\"3:39\",\"7\":[{\"col1\":\"soprano\"},{\"col1\":\"mixed choir\"},{\"col1\":\"harp\"},{\"col1\":\"string orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jun-Chiang Chiu\"},{\"col1\":\"orchestra\",\"col2\":\"Taipei Philharmonics\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:24:57', '2013-08-27 14:24:57', '8e37533c-3dcd-48c1-9890-4a45c38c559f'),
 ('188', '56', '2', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Orchestra\",\"slug\":\"orchestra\",\"postDate\":1377518520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"71\",\"208\",\"212\",\"216\",\"220\",\"224\"]}}', '2013-08-27 14:25:07', '2013-08-27 14:25:07', '224597dc-1bb4-411d-a760-71da971c6ce3'),
 ('189', '228', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"\\\"V\\\" to Transformative Lightness of Beings\",\"slug\":\"v-to-transformative-lightness-of-beings\",\"postDate\":1377614037,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"225\",\"226\"],\"41\":[\"227\"],\"3\":\"<p>\\r\\n\\tMaestro Hu, Yongyen told me, \\\"Hsin-Lei, give me Wagner. We want Wagner.\\\" And I though, \\\"It\'s about time to go back to German style.\\\"\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThis piece is inspired by Wagner\'s Valkyrie, and quoted many leitmotivs.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWagner\'s aesthetics to war, violence, destroy and the pleasant comes afterwards are too excitingly brutal for me to accept. There is no fatherly-kind reliable and warm spirit in the opera; it\'s restless. It\'s reality. It\'s way too close to us. After being through the delicatly-processed agony and force, here comes the hope and eager for piece.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tBeethoven\'s motive, orchestration, phrasing and chord is the foundation of this piece. If Wagner is the deep ocean that can swallow and destroy everything, Beethoven is the broad sea that give the world life. With Beethoven\'s spirit, there is courage to floor in the waves of thunderstorm.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThis piece is about struggling. Struggle in between hope and desperation, against lust and desire like black hole of humanity, and yet, after everything have been through, still peruse the brightness, the reflection of sun, the light of the promise land.\\r\\n<\\/p>\",\"8\":\"19:24\",\"7\":[{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Xu, Zhi Lian\"},{\"col1\":\"orchestra\",\"col2\":\"EOS orchestra\"}],\"10\":\"\",\"14\":\"2005\"}}', '2013-08-27 14:33:57', '2013-08-27 14:33:57', '1fdd4dc4-add1-4e1c-9ccd-802bc54553cd'),
